import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';

const Header = () => {
  return (
    <header className="bg-black p-4">
      <nav className="container mx-auto flex justify-between items-center">
        <div className="flex justify-between items-center w-full">
          <div className="flex space-x-8 text-white font text-xl">
            <Link to="/our-story" className="nav-link">our story</Link>
            <Link to="/events" className="nav-link">events</Link>
          </div>
          <div className="flex justify-center flex-grow">
            <img src={logo} alt="Unplug Club" className="h-12" />
          </div>
          <div className="flex space-x-4 text-white font text-xl">
            <Link to="/how-to-detox" className="nav-link">how to detox</Link>
            <Link to="/contact" className="nav-link">contact</Link>
          </div>
        </div>
      </nav>
    </header>
  );
};

export default Header;
